script: |
  super -f text -I q4102.spq | sort > q4102.out

inputs:
  - name: q4102.spq
    data: |
      SELECT DISTINCT 16 + - 69 * tab2.col1 AS col0 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q4102.out
    data: |
      -1157
      -2123
      -4055
